import React from 'react'
import logo from '../images/png/velar-high-resolution-logo-transparent.png'

export default function Footer() {
  return (
    <React.Fragment>
        <div className='footerContainer'>
            <div><img src={logo} alt='logo'/></div>
            <div></div>
            <div></div>
        </div>
    </React.Fragment>
  )
}
